ce of family law in Sonoma County.  <a href=\"https://scba7.wilcoxdigital.org/sections/family-law\">(Read More...)</a>','publish','closed','closed','','family-law','','','2017-09-06 11:55:50','2017-09-06 17:55:50','',0,'http://development.local/shop/uncategorized/family-law/',18,'product','',0),(1416,4,'2017-09-06 11:56:22','2017-09-06 17:56:22','Labor &amp; Employment Section','Labor & Employment','The Labor and Employment Law Section is a diverse and welcoming group that covers traditional labor law as well as employment law, representing both employers and employees.  <a href=\"https://scba7.wilcoxdigital.org/sections/labor-employment\">(Read More...)</a>','publish','closed','closed','','labor-employment','','','2017-09-06 11:56:22','2017-09-06 17:56:22','',0,'http://development.local/shop/uncategorized/labor-employment/',19,'product','',0),(1417,4,'2017-09-06 11:57:33','2017-09-06 17:57:33','LGBTQI Law section','LGBTQI Law','The LGBTQI Law Section provides a strong leadership presence for lesbian, gay, bisexual, transgender, queer/questioning and intersex persons in the legal profession and in the community at large.  <a href=\"https://scba7.wilcoxdigital.org/sections/lgbtqi-law\">(Read More...)</a>','publish','closed','closed','','lgbtqi-law','','','2017-09-06 11:57:33','2017-09-06 17:57:33','',0,'http://development.local/shop/uncategorized/lgbtqi-law/',20,'product','',0),(1418,4,'2017-09-06 11:57:58','2017-09-06 17:57:58','Public Law Section','Public Law','The Public Law Section provides a forum for members to discuss current legal trends and developments in the area of public law so that we can provide the best possible legal service to our clients.  <a href=\"https://scba7.wilcoxdigital.org/sections/public-law\">(Read More...)</a>','publish','closed','closed','','public-law','','','2017-09-06 11:57:58','2017-09-06 17:57:58','',0,'http://development.local/shop/uncategorized/public-law/',21,'product','',0),(1419,4,'2017-09-06 11:58:17','2017-09-06 17:58:17','Real Property Section','Real Property','The Real Property Section is a community of lawyers practicing and others interested in real property law. It plans educational programs on real property topics.  <a href=\"https://scba7.wilcoxdigital.org/sections/real-property\">(Read More...)</a>','publish','closed','closed','','real-property','','','2017-09-06 11:58:17','2017-09-06 17:58:17','',0,'http://development.local/shop/uncategorized/real-property/',22,'product','',0),(1420,4,'2017-09-06 11:58:41','2017-09-06 17:58:41','Trusts &amp; Estates Section','Trusts & Estates','The Trusts &amp; Estates Section works to improve trusts &amp; estates legal services in Sonoma County by offering continuing education courses and social activities aimed at promoting collegial relationships among trusts &amp; estates practitioners.  <a href=\"https://scba7.wilcoxdigital.org/sections/trusts-estates\">(Read More...)</a>','publish','closed','closed','','trusts-estates','','','2017-09-06 11:58:41','2017-09-06 17:58:41','',0,'http://development.local/shop/uncategorized/trusts-estates/',23,'product','',0),(1421,4,'2017-09-06 11:59:29','2017-09-06 17:59:29','Archive Committee','Archive','<label class=\"pmprorh_checkbox_label\" for=\"archive_committee_member\">The Archive Committee gathers significant historical information and artifacts about SCBA and its notable members and disseminates this information to the Sonoma County community.  <a href=\"https://scba7.wilcoxdigital.org/committees/archive-committee\">(Read More...)</a></label>','publish','closed','closed','','archive','','','2017-09-06 11:59:29','2017-09-06 17:59:29','',0,'http://development.local/shop/uncategorized/archive/',31,'product','',0),(1422,4,'2017-09-06 12:00:07','2017-09-06 18:00:07','Communications Committee','Communications','<label class=\"pmprorh_checkbox_label\" for=\"communications_committee_member\">The Communications Committee prepares content and solicits advertising for the quarterly Bar Journal, the annual SCBA