,'2018-01-24 05:18:06','',0,'http://development.local/shop/uncategorized/donation-sonoma-county-law-library/',2,'product','',0),(2817,70,'2018-01-23 22:33:03','2018-01-24 05:33:03','','Contribution to Legal Aid of Sonoma County','','publish','closed','closed','','give-a-donation-to-sonoma-county-legal-aid','','','2018-01-23 22:33:03','2018-01-24 05:33:03','',0,'http://development.local/shop/uncategorized/give-a-donation-to-sonoma-county-legal-aid/',3,'product','',0),(2825,70,'2018-01-24 19:45:23','2018-01-25 02:45:23','Insurance Law','Insurance Law','','publish','closed','closed','','insurance-law','','','2018-01-24 19:45:23','2018-01-25 02:45:23','',0,'http://development.local/shop/uncategorized/insurance-law/',83,'product','',0),(2827,70,'2018-01-24 19:49:18','2018-01-25 02:49:18','Wild Fires Litigation','Wild Fires Litigation','','publish','closed','closed','','wild-fires-litigation','','','2018-01-24 19:49:18','2018-01-25 02:49:18','',0,'http://development.local/shop/uncategorized/wild-fires-litigation/',122,'product','',0),(2920,70,'2018-02-11 16:27:49','2018-02-11 23:27:49','<div id=\"post-9399\" class=\"post-9399 post type-post status-publish format-standard hentry category-general-law category-mcle odd\">\r\n<div class=\"post-bodycopy clearfix\"><center><span style=\"font-size: small;\">This focused class will address the proper use and the limitations of the following types of restraining orders:</span></center>\r\n<center>\r\n<table>\r\n<tbody>\r\n<tr class=\"alt\">\r\n<td>\r\n<ul>\r\n 	<li>Emergency Protective Orders</li>\r\n 	<li>Civil Harassment</li>\r\n 	<li>Workplace Violence</li>\r\n 	<li>Domestic Violence</li>\r\n</ul>\r\n</td>\r\n<td>\r\n<ul>\r\n 	<li>Juvenile Dependency/Delinquency</li>\r\n 	<li>Elder Abuse</li>\r\n 	<li>School Violence</li>\r\n 	<li>Gun Violence</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\nDialogue will be encouraged and questions will be taken throughout the presentation.\r\n\r\n<a href=\"http://www.sonomacountybar.org/wp-content/uploads/2013/12/Wick-Andy.jpg\"><img class=\"alignleft size-thumbnail wp-image-5416\" src=\"http://www.sonomacountybar.org/wp-content/uploads/2013/12/Wick-Andy-150x150.jpg\" alt=\"Wick, Andy\" width=\"150\" height=\"150\" /></a>\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n</center>\r\n<strong>Hon. Arthur A. Wick</strong>\r\nSuperior Court Judge\r\nSuperior Court of California, County of SonomaAfter graduating third in his class from law school in 1980, Judge Wick practiced law for 26 years specializing in the representation of school and college districts and represented some 225 school and college districts throughout the state. He tried cases in 13 different jurisdictions during his carrier. Judge Wick was appointed to the Sonoma County Superior Court in April 2006 by Governor Schwarzenegger. He currently sits in a felony trial court, after being the Supervising Judge of the Civil Division and presiding over the Appellate Division of the superior court as its Presiding Judge.<a href=\"http://www.sonomacountybar.org/wp-content/uploads/2017/08/Wheeldin-Anthony-Hon.-2012-Directory.jpg\"><img class=\"alignright size-thumbnail wp-image-9401\" src=\"http://www.sonomacountybar.org/wp-content/uploads/2017/08/Wheeldin-Anthony-Hon.-2012-Directory-150x150.jpg\" alt=\"wheeldin-anthony-hon-2012-directory\" width=\"150\" height=\"150\" /></a>\r\n<p align=\"RIGHT\"><strong>Hon. Anthony Wheeldin</strong>\r\nSuperior Court Commissioner\r\nSuperior Court of California, County of Sonoma</p>\r\nA graduate of Wesleyan University and UCLA School of Law, Commissioner Wheeldin began a civil practice in Sonoma County in 1981. He has tried cases to verdict throughout the Bay Area and taught Civil Procedure at Empire College of Law from 1989 until 2015. Appointed a Commissioner in 2011, his prior assignments include dependency and misdemeanors. His current assignment is Traffic as well as the Civil Harassment and Workplace Violence calendars.\r\n<blockquote><b>Date:</b> Friday, February 16, 2018\r\n\r\n<b>Time:</b> Check-In: 11:45 am; Presentation: 12:00—1:30 pm\r\n\r\n<b>Presenter(s):</b>\r\n<strong>Hon. Arthur A. Wick</strong>, Superior Court Judge, Superior Court of California, County of Sonoma\r\n<strong>Hon. Anthony Wheeldin</strong>, Superior Court Commissioner, Superior Court of California, County of Sonoma\r\n\r\n<b>Place:</b> SCBA Office, 111 Santa Rosa Ave., Ste. 222, Santa Rosa, CA 95404\r\nParking for this seminar is ONLY available in the Public Parking Garage at 555 First Street.\r\n<u><b>Please do not park in the parking lot at 111 Santa Rosa Avenue.</b></u>\r\n\r\n<b>Registration Fee:</b> $75–SCBA Members; $85–Public;\r\n\r\n<b>MCLE:</b> 1.5 Units Participatory Credit in General Law\r\n\r\n<strong>Student:</strong> $20 (The student discount is now available online for SCBA Student Members. Students who are not members of SCBA may utilize the student discount by downloading the registration form and submitting it with proof of current enrollment to the SCBA Offices. For more information on becoming a member of SCBA, please contact Susan Demers at (707) 542-1190 ext. 18.)\r\n\r\n<a href=\"http://www.sonomacountybar.org/controller.cfm?view=public.event_detail&amp;cid=04422EBC-155D-7155-9A02DE79E20EE8BD\">Click Here to Register</a>\r\n<a href=\"http://www.sonomacountybar.org/wp-content/uploads/2017/08/2018-02-16-Restraining-Orders-NEW-DATE.pdf\">Click Here to Download the Registration Flyer</a></blockquote>\r\n</div>\r\n<div class=\"post-footer\">August 14th, 2017 | Category: <a href=\"http://www.sonomacountybar.org/?cat=67\" rel=\"category\">General Law</a>, <a href=\"http://www.sonomacountybar.org/?cat=4\" rel=\"category\">MCLE Classes</a></div>\r\n</div>\r\nComments are closed.','Restraining Orders','Here is a product description.','publish','closed','closed','','restraining-orders','','','2018-02-11 16:27:49','2018-02-11 23:27:49','',0,'http://development.local/shop/uncategorized/restraining-orders/',0,'product','',0),(2921,1,'2019-01-17 13:38:19','2019-01-17 20:38:19','','Restraining Orders 1','','inherit','open','closed','','restraining-orders-1','','','2019-01-17 13:38:19','2019-01-17 20:38:19','',2920,'http://development.local/wp-content/uploads/2019/01/bozo3.jpg',0,'attachment','image/jpeg',0),(2929,70,'2018-02-11 20:06:15','2018-02-12 03:06:15','<div id=\"post-9417\" class=\"post-9417 post type-post status-publish format-standard hentry category-general-law category-mcle odd\">\r\n<div class=\"post-headline\">\r\n<h1>NEW DATE: Settlement of Employment Claims</h1>\r\n</div>\r\n<div class=\"post-byline\">Published August 14th, 2017</div>\r\n<div class=\"post-bodycopy clearfix\"><center><span style=\"font-size: small;\">Avoiding the Common Pitfalls</span></center>\r\n<center><span style=\"font-size: xx-small;\">Settling employment claims involves more than paying money in exchange for a release. Some claims are not released; payments may be apportioned and paid over time; confidentiality obligations may be imposed; consequences for breach of the agreement may be specified. Things that make settling employment claims challenging will be presented and discussed with the group.</span></center><a href=\"http://www.sonomacountybar.org/wp-content/uploads/2016/01/Mazzia-Chris-2012-Directory-reduced-size.jpg\"><img class=\"alignleft size-thumbnail wp-image-7389\" src=\"http://www.sonomacountybar.org/wp-content/uploads/2016/01/Mazzia-Chris-2012-Directory-reduced-size-150x150.jpg\" alt=\"Mazzia, Chris - 2012 Directory - reduced size\" width=\"150\" height=\"150\" /></a>\r\n<strong>Christopher Mazzia</strong>\r\nAnderson Zeigler, A Professional CorporationMr. Mazzia focuses on all aspects of civil litigation, representing both plaintiffs and defendants. Mr. Mazzia’s practice includes counseling employers and employees in litigation and business matters. Mr. Mazzia is a former officer of the Board of the Sonoma County Bar Association.<a href=\"http://www.sonomacountybar.org/wp-content/uploads/2017/08/Shklovsky-Michael.jpg\"><img class=\"alignright size-thumbnail wp-image-9419\" src=\"http://www.sonomacountybar.org/wp-content/uploads/2017/08/Shklovsky-Michael-150x150.jpg\" alt=\"shklovsky-michael\" width=\"150\" height=\"150\" /></a>\r\n<p align=\"RIGHT\"><strong>Michael Shklovsky </strong>\r\nAnderson Zeigler, A Professional Corporation</p>\r\nMr. Shklovsky is a seasoned trial attorney with experience in all facets of civil litigation. He routinely counsels businesses and individuals in employment matters. Mr. Shklovsky is the past Chair of the Alameda County Bar Association’s Trial Practice Section, member of the Business Litigation Committee of the California State Bar, and a yearly recipient of the Super Lawyers’ Rising Star award in Business Litigation since 2015.\r\n<blockquote><b>Date:</b> Thursday, March 1, 2018\r\n\r\n<b>Time:</b> Check-In: 3:45 pm; Presentation: 4:00—5:00 pm\r\n\r\n<b>Presenter(s):</b>\r\nChristopher Mazzia, Anderson Zeigler, A Professional Corporation\r\nMichael Shklovsky, Anderson Zeigler, A Professional Corporation\r\n\r\n<b>Place:</b> SCBA Office, 111 Santa Rosa Ave., Ste. 222, Santa Rosa, CA 95404\r\n\r\n<strong>Parking for this seminar is only available in the Public Parking Garage at 555 First Street.</strong>\r\n\r\n<strong>Please do not park in the parking lot at 111 Santa Rosa Avenue.</strong>\r\n\r\n<b>MCLE:</b> 1.0 Unit Participatory Credit in General Law\r\n\r\n<a href=\"http://www.sonomacountybar.org/controller.cfm?view=public.event_detail&amp;cid=6EBA5B16-155D-7155-A00E7D34952CA5CA\">Click Here to Register</a>\r\n<a href=\"http://www.sonomacountybar.org/wp-content/uploads/2017/08/2018-03-01-Settlement-of-Employment-Claims-NEW-DATE-corrected.pdf\">Click Here to Download the Registration Flyer</a></blockquote>\r\n</div>\r\n<div class=\"post-footer\">August 14th, 2017 | Category: <a href=\"http://www.sonomacountybar.org/?cat=67\" rel=\"category\">General Law</a>, <a href=\"http://www.sonomacountybar.org/?cat=4\" rel=\"category\">MCLE Classes</a></div>\r\n</div>\r\nComments are closed.','Settlement of Employment Claims','','publish','closed','closed','','settlement-of-employment-claims','','','2018-02-11 20:06:15','2018-02-12 03:06:15','',0,'http://development.local/shop/uncategorized/settlement-of-employment-claims/',0,'product','',0),(2930,1,'2019-01-17 13:38:19','2019-01-17 20:38:19','','Settlement of Employment Claims 1','','inherit','open','closed','','settlement-of-employment-claims-1','','','2019-01-17 13:38:19','2019-01-17 20:38:19','',2929,'http://development.local/wp-content/uploads/2019/01/SCBA-Offices-1.jpg',0,'attachment','image/jpeg',0),(3113,70,'2018-03-02 22:08:14','2018-03-03 05:08:14','','Civil Trial Workshop','','publish','closed','closed','','civil-trial-workshop','','','2018-03-02 22:08:14','2018-03-03 05:08:14','',0,'http://development.local/shop/uncategorized/civil-trial-workshop/',0,'product','',0),(3120,70,'2018-03-03 22:00:39','2018-03-04 05:00:39','','2015-8-10 Deposition Objections','Perry Mason','publish','closed','closed','','2015-8-10-deposition-objections','','','2018-03-03 22:00:39','2018-03-04 05:00:39','',0,'http://development.local/shop/uncategorized/2015-8-10-deposition-objections/',0,'product','',0),(3249,70,'2018-03-19 20:44:35','2018-03-20 02:44:35','<h1 class=\"section-title\">Starting a Business in Sonoma County</h1>\r\n<h2><strong>So you want to start a New Business?</strong></h2>\r\nYou have a <strong>great</strong> idea for a new business and you see the demand and the need for your services. Before you rent your office or design your letterhead, it\'s wise to understand <strong>the different business entities</strong> and what <strong>levels of protection</strong> they supply to you personally.\r\n\r\nThis course walks you through the process of considering business entities, employee policies, and tax considerations before you dive head first into your entrepreneurial venture.\r\n\r\n<hr />\r\n\r\n<h3><strong>Useful Resources</strong></h3>\r\nTo help get you started, here are a few of our community\'s favorite resources:\r\n\r\n<strong>Sonoma County - Services for Businesses</strong>\r\n\r\n<a href=\"http://sonomacounty.ca.gov/Services/Services-for-Businesses/\">http://sonomacounty.ca.gov/Services/Services-for-B...</a>\r\n\r\n<strong>Sonoma County Economic Development Board</strong>\r\n\r\n<a href=\"http://sonomaedb.org/Business-Assistance/\">http://sonomaedb.org/Business-Assistance/</a>\r\n\r\n<hr />\r\n\r\n<div class=\"instructor__details\">\r\n<h3 class=\"instructor__name\" style=\"text-align: left;\"><strong>Instructor:</strong></h3>\r\n<h3 class=\"instructor__name\" style=\"text-align: center;\">James F. DeMartini</h3>\r\n<h4 class=\"instructor__title\" style=\"text-align: center;\">Attorney at Law</h4>\r\n</div>\r\n<div class=\"instructor__bio\" style=\"text-align: center;\">Jim DeMartini has practiced law in the County of Sonoma since 1977.</div>\r\n<div class=\"instructor__bio\" style=\"text-align: center;\">\r\n\r\nHe specializes in Business Law, Cannabis Compliance, and Employment Law.\r\n<div class=\"course-contact-info\">\r\n\r\n<hr />\r\n\r\n<h3><strong>Law Offices of James F. DeMartini</strong></h3>\r\n<h4>115 W First Street\r\nCloverdale, CA 95425\r\nTel: (707) 894-5000\r\nFax: (707) 894-3127\r\njim@cloverdalelaw.com</h4>\r\n<a href=\"http://www.cloverdalelaw.com/\">www.cloverdalelaw.com</a>\r\n\r\n<hr />\r\n\r\n<h2 class=\"section-title\" style=\"text-align: left;\">Course Curriculum</h2>\r\n<h2 class=\"section-title\" style=\"text-align: left;\"><strong><em><span class=\"chapter-list-item__title\">Starting a Sonoma County Business</span></em></strong></h2>\r\n<div class=\"curriculum-chapter\" style=\"text-align: left;\">\r\n<div class=\"chapter-toggle\">\r\n<div id=\"collapse1\" class=\"row in\"></div>\r\n<div class=\"row\">\r\n<div class=\"col-sm-12\">\r\n<div class=\"toggle-content\" data-toggle=\"collapse\" data-target=\"#collapse1\"><strong>Introduction</strong></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"curriculum-chapter\" style=\"text-align: left;\">\r\n<div class=\"chapter-toggle\">\r\n<div class=\"curriculum-chapter-header\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-12\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-9\"><strong><span class=\"chapter-header\">What Kind of Business are you founding?</span></strong></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div id=\"collapse2\" class=\"row in\">\r\n<div class=\"col-sm-12\">\r\n<div class=\"chapter-list\">\r\n<ul>\r\n 	<li class=\"chapter-list-item\"><span class=\"chapter-list-item__title\">Know about Business Entities</span><i class=\"icon-htmlitem\"></i></li>\r\n 	<li class=\"chapter-list-item\"><span class=\"chapter-list-item__title\">Business Entities #1</span><i class=\"icon-audio\"></i></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-sm-12\">\r\n<div class=\"toggle-content\" data-toggle=\"collapse\" data-target=\"#collapse2\"><strong>Learning about Liabilities and Protection</strong></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"curriculum-chapter\">\r\n<div class=\"chapter-toggle\">\r\n<div class=\"curriculum-chapter-header\" style=\"text-align: left;\">\r\n<ul>\r\n 	<li class=\"col-sm-12 chapter-description\">Understanding how an Entity Protects you</li>\r\n 	<li class=\"col-sm-12 chapter-description\">Business Entities #2</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"curriculum-chapter\" style=\"text-align: left;\"></div>\r\n<div class=\"curriculum-chapter\"></div>\r\n</div>\r\n</div>\r\n&nbsp;\r\n<div class=\"thinkific-product-card\" data-btn-txt=\"Enroll in this Course\" data-btn-txt-color=\"#ffffff\" data-btn-bg-color=\"#1b9eea\" data-card-type=\"button\" data-link-type=\"checkout\" data-product=\"111397\" data-embed-version=\"0.0.2\" data-store-url=\"https://courses.thinkific.com/embeds/products/show\">\r\n<div class=\"iframe-container\"></div>\r\n<script type=\"text/javascript\">document.getElementById(\"thinkific-product-embed\") || document.write(\'<script id=\"thinkific-product-embed\" type=\"text/javascript\" src=\"https://assets.thinkific.com/js/embeds/product-cards-client.min.js\"></script>\');</script>\r\n\r\n</div>','Starting a Business in Sonoma County 1','','publish','closed','closed','','starting-a-business-in-sonoma-county-1','','','2018-03-19 20:44:35','2018-03-20 02:44:35','',0,'http://development.local/shop/uncategorized/starting-a-business-in-sonoma-county-1/',0,'product','',0),(3253,70,'2018-03-19 20:47:32','2018-03-20 02:47:32','Looking east into Italy from 12,000 feet near Mont Blanc.','French Alps and Latino Culture','','publish','closed','closed','','french-alps-and-latino-culture','','','2018-03-19 20:47:32','2018-03-20 02:47:32','',0,'http://development.local/shop/uncategorized/french-alps-and-latino-culture/',0,'product','',0),(3254,70,'2018-03-19 20:49:21','2018-03-20 02:49:21','Audio was synced over PPt slides in PPt, then exported as video.','PowerPoint Turned Video Course','','publish','closed','closed','','powerpoint-turned-video-course','','','2018-03-19 20:49:21','2018-03-20 02:49:21','',0,'http://development.local/shop/uncategorized/powerpoint-turned-video-course/',0,'product','',0),(3449,70,'2018-04-29 12:13:21','2018-04-29 18:13:21','<div class=\"post-headline\">\r\n<h1>Summer CEQA Update</h1>\r\n</div>\r\n<div class=\"post-byline\">Published April 19th, 2018</div>\r\n<div class=\"post-bodycopy clearfix\"><center><span style=\"font-size: xx-small;\">An Update on What is New with the California Environmental Quality Act Since SCBA’s Winter CEQA Update in December 2017.</span></center>\r\n<a href=\"http://www.sonomacountybar.org/wp-content/uploads/2014/06/Perry-Leslie.jpg\"><img class=\"alignright size-thumbnail wp-image-5947\" src=\"http://www.sonomacountybar.org/wp-content/uploads/2014/06/Perry-Leslie-150x150.jpg\" alt=\"Perry, Leslie\" width=\"150\" height=\"150\" /></a>\r\n<p align=\"RIGHT\"><strong>Leslie Perry</strong>\r\nPerry, Johnson, Anderson, Miller &amp; Moskowitz, LLP</p>\r\nMr. Perry has practiced law in Sonoma County since 1975. He practices in the areas of land use and real property. He represents clients before various administrative and planning agencies as well as land use and environmental litigation, with an emphasis in CEQA matters. Mr. Perry is a founding partner of Perry, Johnson, Anderson, Miller &amp; Moskowitz and previously partner with the firm of Luke &amp; Perry. He is an AV Preeminent® Peer Review Rated attorney.\r\n\r\n<a href=\"http://www.sonomacountybar.org/wp-content/uploads/2016/06/Wallis-Tina-Bio-Photo-1-resized.jpg\"><img class=\"alignright size-thumbnail wp-image-8000\" src=\"http://www.sonomacountybar.org/wp-content/uploads/2016/06/Wallis-Tina-Bio-Photo-1-resized-150x150.jpg\" alt=\"Wallis, Tina - Bio Photo 1 - resized\" width=\"150\" height=\"150\" /></a>\r\n<p align=\"RIGHT\"><strong>Tina Wallis</strong>\r\nLaw Offices of Tina Wallis, Inc.</p>\r\nMs. Wallis has her own law firm where she practices land use and environmental law. Ms. Wallis previously served an Assistant City Attorney and Deputy County Counsel advising counties, cities, and special districts on land use, environmental, public works, general government, airport and landfill matters. Since 2008, Ms. Wallis advises private and public clients on all aspects of land use, such as general plan updates, zoning code updates, compliance with California’s Environmental Quality Act, land use entitlements for residential and commercial projects, and conservation easements. Additionally, Ms. Wallis defends property owners in enforcement actions brought by Regional Water Boards, the California Department of Fish and Game, cities, and counties.\r\n\r\n<a href=\"http://www.sonomacountybar.org/wp-content/uploads/2015/05/Zoia-Rose.jpg\"><img class=\"alignright size-thumbnail wp-image-6625\" src=\"http://www.sonomacountybar.org/wp-content/uploads/2015/05/Zoia-Rose-150x150.jpg\" alt=\"Zoia, Rose\" width=\"150\" height=\"150\" /></a>\r\n<p align=\"RIGHT\"><strong>Rose Zoia</strong>\r\nLaw Office of Rose M. Zoia</p>\r\nMs. Zoia’s practice focuses on land use law and civil appeals and writs. She focuses on CEQA and general plan and zoning laws. She has practiced in more than a dozen superior courts in counties throughout California as well as in each of the six districts of the California Courts of Appeal and the Eastern, Central and Northern Districts of the United States District Court and the Ninth Circuit United States Court of Appeal.\r\n<blockquote><b>Date:</b> Tuesday, June 5, 2018\r\n\r\n<b>Time:</b> Check-In: 11:45 am; Presentation: 12:00—1:30 pm\r\n\r\n<b>Presenter(s):</b>\r\nLeslie Perry, Perry, Johnson, Anderson, Miller &amp; Moskowitz, LLP\r\nTina Wallis, Law Offices of Tina Wallis, Inc.\r\nRose Zoia, Law Office of Rose M. Zoia\r\n\r\n<b>Place:</b> SCBA Office, 111 Santa Rosa Ave., Ste. 222, Santa Rosa, CA 95404.\r\nParking for this seminar is ONLY available in the Public Parking Garage at 555 First Street.\r\n<u><b>Do not park in the parking lot at 111 Santa Rosa Avenue.</b></u>\r\n\r\n<b>MCLE:</b> 1.5 Units Participatory Credit in General Law\r\n\r\n<b>Registration Fee:</b> $70–SCBA Members; $85–Public\r\n\r\n<strong>Student:</strong> $20 (The student discount is now available online for SCBA Student Members. Students who are not members of SCBA may utilize the student discount by downloading the registration form and submitting it with proof of current enrollment to the SCBA Offices. For more information on becoming a member of SCBA, please contact Susan Demers at (707) 542-1190 ext. 18.)\r\n\r\n<a href=\"http://www.sonomacountybar.org/controller.cfm?view=public.event_detail&amp;cid=B27B198A-A44A-B71C-E2A8BE5DCE50EF80\">Click Here to Register</a>\r\n<a href=\"http://www.sonomacountybar.org/wp-content/uploads/2018/04/2018-06-05-Summer-CEQA-Update.pdf\">Click Here to Download the Registration Flyer</a></blockquote>\r\n</div>','Summer CEQA Update','','publish','closed','closed','','summer-ceqa-update','','','2018-04-29 12:13:21','2018-04-29 18:13:21','',0,'http://development.local/shop/uncategorized/summer-ceqa-update/',0,'product','',0),(3450,1,'2019-01-17 13:38:23','2019-01-17 20:38:23','','Summer CEQA Update 1','','inherit','open','closed','','summer-ceqa-update-1','','','2019-01-17 13:38:23','2019-01-17 20:38:23','',3449,'http://development.local/wp-content/uploads/2019/01/ceqa_2.jpg',0,'attachment','image/jpeg',0),(3453,70,'2018-05-02 10:23:58','2018-05-02 16:23:58','Appellate Certified Specialist','Appellate Certified Specialist','','publish','closed','closed','','appellate-certified-specialist','','','2018-05-02 10:23:58','2018-05-02 16:23:58','',0,'http://development.local/shop/uncategorized/appellate-certified-specialist/',29,'product','',0),(3454,70,'2018-05-02 10:35:09','2018-05-02 16:35:09','Employee Benefits','Employee Benefits','','publish','closed','closed','','employee-benefits','','','2018-05-02 10:35:09','2018-05-02 16:35:09','',0,'http://development.local/shop/uncategorized/employee-benefits/',58,'product','',0),(3456,70,'2018-05-02 10:39:21','2018-05-02 16:39:21','Franch. &amp; Dist. Law Spec.','Franchise & Dist. Law Specialist','','publish','closed','closed','','franchise-distribution-law-specialist','','','2018-05-02 10:39:21','2018-05-02 16:39:21','',0,'http://development.local/shop/uncategorized/franchise-distribution-law-specialist/',75,'product','',0),(3457,70,'2018-05-02 10:42:36','2018-05-02 16:42:36','Immigration Cert. Spec.','Immigration Certified Specialist','','publish','closed','closed','','immigration-certified-specialist','','','2018-05-02 10:42:36','2018-05-02 16:42:36','',0,'http://development.local/shop/uncategorized/immigration-certified-specialist/',80,'product','',0),(3515,70,'2018-05-08 11:18:11','2018-05-08 17:18:11','Speaker: Brian Barboza, Law Offices of Brian A. Barboza\r\n\r\n<hr />\r\n\r\nPages: 42','Creditors\' Rights in Bankru