08 21:04:56','',0,'http://development.local/shop/uncategorized/unlawful-retainer-from-notice-to-writ/',0,'product','',0),(3552,70,'2018-05-08 15:10:03','2018-05-08 21:10:03','Speakers:\r\n\r\nDr. Andrew Wagner - Memorial Hospice\r\n\r\nSarah Hooper, Executive Director - UCSF / UC Hastings Consortium\r\n\r\n<hr />\r\n\r\nPages: 61','End of Life Option Act','Dr. Andrew Wagner - Sarah Hooper','publish','closed','closed','','end-of-life-option-act','','','2018-05-08 15:10:03','2018-05-08 21:10:03','',0,'http://development.local/shop/uncategorized/end-of-life-option-act/',0,'product','',0),(3772,70,'2018-06-06 10:18:49','2018-06-06 16:18:49','<div class=\"post-headline\">\r\n<h1>Summer CEQA Update</h1>\r\n</div>\r\n<div class=\"post-byline\">Published April 19th, 2018</div>\r\n<div class=\"post-bodycopy clearfix\"><center><span style=\"font-size: xx-small;\">An Update on What is New with the California Environmental Quality Act Since SCBA’s Winter CEQA Update in December 2017.</span></center>\r\n<a href=\"http://www.sonomacountybar.org/wp-content/uploads/2014/06/Perry-Leslie.jpg\"><img class=\"alignright size-thumbnail wp-image-5947\" src=\"http://www.sonomacountybar.org/wp-content/uploads/2014/06/Perry-Leslie-150x150.jpg\" alt=\"Perry, Leslie\" width=\"150\" height=\"150\" /></a>\r\n<p align=\"RIGHT\"><strong>Leslie Perry</strong>\r\nPerry, Johnson, Anderson, Miller &amp; Moskowitz, LLP</p>\r\nMr. Perry has practiced law in Sonoma County since 1975. He practices in the areas of land use and real property. He represents clients before various administrative and planning agencies as well as land use and environmental litigation, with an emphasis in CEQA matters. Mr. Perry is a founding partner of Perry, Johnson, Anderson, Miller &amp; Moskowitz and previously partner with the firm of Luke &amp; Perry. He is an AV Preeminent® Peer Review Rated attorney.\r\n\r\n<a href=\"http://www.sonomacountybar.org/wp-content/uploads/2016/06/Wallis-Tina-Bio-Photo-1-resized.jpg\"><img class=\"alignright size-thumbnail wp-image-8000\" src=\"http://www.sonomacountybar.org/wp-content/uploads/2016/06/Wallis-Tina-Bio-Photo-1-resized-150x150.jpg\" alt=\"Wallis, Tina - Bio Photo 1 - resized\" width=\"150\" height=\"150\" /></a>\r\n<p align=\"RIGHT\"><strong>Tina Wallis</strong>\r\nLaw Offices of Tina Wallis, Inc.</p>\r\nMs. Wallis has her own law firm where she practices land use and environmental law. Ms. Wallis previously served an Assistant City Attorney and Deputy County Counsel advising counties, cities, and special districts on land use, environmental, public works, general government, airport and landfill matters. Since 2008, Ms. Wallis advises private and public clients on all aspects of land use, such as general plan updates, zoning code updates, compliance with California’s Environmental Quality Act, land use entitlements for residential and commercial projects, and conservation easements. Additionally, Ms. Wallis defends property owners in enforcement actions brought by Regional Water Boards, the California Department of Fish and Game, cities, and counties.\r\n\r\n<a href=\"http://www.sonomacountybar.org/wp-content/uploads/2015/05/Zoia-Rose.jpg\"><img class=\"alignright size-thumbnail wp-image-6625\" src=\"http://www.sonomacountybar.org/wp-content/uploads/2015/05/Zoia-Rose-150x150.jpg\" alt=\"Zoia, Rose\" width=\"150\" height=\"150\" /></a>\r\n<p align=\"RIGHT\"><strong>Rose Zoia</strong>\r\nLaw Office of Rose M. Zoia</p>\r\nMs. Zoia’s practice focuses on land use law and civil appeals and writs. She focuses on CEQA and general plan and zoning laws. She has practiced in more than a dozen superior courts in counties throughout California as well as in each of the six districts of the California Courts of Appeal and the Eastern, Central and Northern Districts of the United States District Court and the Ninth Circuit United States Court of Appeal.\r\n<blockquote><b>Date:</b> Tuesday, June 5, 2018\r\n\r\n<b>Time:</b> Check-In: 11:45 am; Presentation: 12:00—1:30 pm\r\n\r\n<b>Presenter(s):</b>\r\nLeslie Perry, Perry, Johnson, Anderson, Miller &amp; Moskowitz, LLP\r\nTina Wallis, Law Offices of Tina Wallis, Inc.\r\nRose Zoia, Law Office of Rose M. Zoia\r\n\r\n<b>Place:</b> SCBA Office, 111 Santa Rosa Ave., Ste. 222, Santa Rosa, CA 95404.\r\nParking for this seminar is ONLY available in the Public Parking Garage at 555 First Street.\r\n<u><b>Do not park in the parking lot at 111 Santa Rosa Avenue.</b></u>\r\n\r\n<b>MCLE:</b> 1.5 Units Participatory Credit in General Law\r\n\r\n<b>Registration Fee:</b> $70–SCBA Members; $85–Public\r\n\r\n<strong>Student:</strong> $20 (The student discount is now available online for SCBA Student Members. Students who are not members of SCBA may utilize the student discount by downloading the registration form and submitting it with proof of current enrollment to the SCBA Offices. For more information on becoming a member of SCBA, please contact Susan Demers at (707) 542-1190 ext. 18.)\r\n\r\n<a href=\"http://www.sonomacountybar.org/controller.cfm?view=public.event_detail&amp;cid=B27B198A-A44A-B71C-E2A8BE5DCE50EF80\">Click Here to Register</a></blockquote>\r\n</div>','FAll 2018 CEQA Update','','publish','closed','closed','','fall-2018-ceqa-update','','','2018-06-06 10:18:49','2018-06-06 16:18:49','',0,'http://development.local/shop/uncategorized/fall-2018-ceqa-update/',0,'product','',0),(3773,1,'2019-01-17 13:38:44','2019-01-17 20:38:44','','FAll 2018 CEQA Update 1','','inherit','open','closed','','fall-2018-ceqa-update-1','','','2019-01-17 13:38:44','2019-01-17 20:38:44','',3772,'http://development.local/wp-content/uploads/2019/01/MCLE_raise_the_bar.jpg',0,'attachment','image/jpeg',0),(3794,70,'2018-06-07 09:36:01','2018-06-07 15:36:01','<div class=\"post-headline\">\r\n<div class=\"clearfix navigation-top\"></div>\r\n<div id=\"post-10254\" class=\"post-10254 post type-post status-publish format-standard hentry category-general-law category-mcle odd\">\r\n<div class=\"post-kicker\"><span style=\"font-size: 30px;\">How to Avoid Landmines in Buy-Sell Agreements: A Business Valuation Expert’s Perspective</span></div>\r\n<div class=\"post-byline\">Published May 11th, 2018</div>\r\n<div class=\"post-bodycopy clearfix\"><center><span style=\"font-size: xx-small;\"> Essential for attorneys that work with buy-sell agreements (BSA’s), this workshop identifies common problems with valuation provisions and recommends practical solutions that attorneys can use to prepare precise and unambiguous agreements that, when triggered, will function as intended and be fair to all concerned, affordable and trouble-free. </span><span style=\"font-size: xx-small;\"><strong><u>Participants Will Learn:</u></strong>\r\n~ Valuation concepts, standards, terminology, and discounts\r\n~ Attorneys’ use of various BSA provisions (from a study of 20 agreements selected at random)\r\n~ Pros and cons of the 3 primary approaches to pricing shares for buy-sell\r\n~ Common BSA problems, illustrated through 9 case studies\r\n~ Recommended solutions</span>&nbsp;\r\n\r\n</center><a href=\"https://www.sonomacountybar.org/wp-content/uploads/2018/05/Statz-Al.jpg\"><img class=\"alignleft size-thumbnail wp-image-10255\" src=\"https://www.sonomacountybar.org/wp-content/uploads/2018/05/Statz-Al-150x150.jpg\" alt=\"Statz, Al\" width=\"150\" height=\"150\" /></a>\r\n<strong>Al Statz, ASA, CBA</strong>\r\nExit Strategies Group, Inc.Mr. Statz is President of Exit Strategies Group, Inc., a mid-size business valuation and M&amp;A brokerage firm with offices in the San Francisco Bay Area, Sacramento area and Orange County. Founded by Al in 2002, Exit Strategies appraises $1-50 million revenue closely-held businesses and fractional interests for buy-sell, management buyout, ESOP, estate and gift tax, dissolution proceedings, succession planning and other uses. Mr. Statz holds an Accredited Senior Appraiser (ASA) credential from the American Society of Appraisers and is a Certified Business Appraiser (CBA) through the Institute of Business Appraisers. He is also a Merger &amp; Acquisition Master Intermediary (M&amp;AMI) through M&amp;A Source. Al advises clients on business sales and recapitalizations and serves on the board of the California Association of Business Brokers.\r\n<blockquote><b>Date:</b> Thursday, August 16, 2018\r\n\r\n<b>Time:</b> Check-In: 11:45 am; Presentation: 12:00—1:00 pm\r\n\r\n<b>Presenter(s):</b>\r\nAl Statz, ASA, CBA, Exit Strategies Group, Inc.\r\n\r\n<b>Place:</b> SCBA Office, 111 Santa Rosa Ave., Ste. 222, Santa Rosa, CA 95404.\r\n<b>Parking for this seminar is ONLY available in the Public Parking Garage at 555 First Street. <u>Do not park in the parking lot at 111 Santa Rosa Avenue.</u></b>\r\n\r\n<b>MCLE:</b> 1.0 Unit Participatory Credit in General Law\r\n\r\n<b>Registration Fee:</b> $60–SCBA Members; $75–Public;\r\n<strong>Student:</strong> $20 (The student discount is now available online for SCBA Student Members. Students who are not members of SCBA may utilize the student discount by downloading the registration form and submitting it with proof of current enrollment to the SCBA Offices. For more information on becoming a member of SCBA, please contact Susan Demers at (707) 542-1190 ext. 18.)\r\n\r\n<a href=\"https://scba7.wilcoxdigital.org/2018-08-16-buy-sell-agreements\">Click Here to Download The Registration Flyer</a></blockquote>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"post-bodycopy clearfix\"></div>','How to Avoid Landmines in Buy-Sell Agreements','','publish','closed','closed','','how-to-avoid-landmines-in-buy-sell-agreements','','','2018-06-07 09:36:01','2018-06-07 15:36:01','',0,'http://development.local/shop/uncategorized/how-to-avoid-landmines-in-buy-sell-agreements/',0,'product','',0),(3795,1,'2019-01-17 13:38:44','2019-01-17 20:38:44','','How to Avoid Landmines in Buy-Sell Agreements 1','','inherit','open','closed','','how-to-avoid-landmines-in-buy-sell-agreements-1','','','2019-01-17 13:38:44','2019-01-17 20:38:44','',3794,'http://development.local/wp-content/uploads/2019/01/landmine2.jpg',0,'attachment','image/jpeg',0),(3924,70,'2018-06-20 21:01:05','2018-06-21 03:01:05','<div class=\"post-kicker\"><span style=\"font-size: 30px;\">Stress, Anxiety, and Depression in the Legal Profession</span></div>\r\n<div class=\"post-byline\">Published May 11th, 2018</div>\r\n<div class=\"post-bodycopy clearfix\"><center><span style=\"font-size: xx-small;\">~ Recognizing Depression in Your Colleagues and Yourself\r\n~ Signs and Symptoms You May Not be Aware Of\r\n~ Why Lawyers?\r\n~ Consequences and What to Do </span><span style=\"font-size: xx-small;\"><strong>Questions and topics you’d like covered may be emailed to Dr. Pierce at <a href=\"mailto:drpierce@barrygpiercemd.net\">drpierce@barrygpiercemd.net</a></strong></span>&nbsp;\r\n\r\n</center><a href=\"https://www.sonomacountybar.org/wp-content/uploads/2018/05/Pierce-Dr.-Barry-G..jpg\"><img class=\"alignleft size-full wp-image-10245\" src=\"https://www.sonomacountybar.org/wp-content/uploads/2018/05/Pierce-Dr.-Barry-G..jpg\" alt=\"Pierce, Dr. Barry G.\" width=\"102\" height=\"119\" /></a>\r\n<strong>Barry G. Pierce, M.D.</strong>Dr. Pierce is a psychiatrist in private practice in Santa Rosa, California. He blends 25 years of psychotherapy training and experience into an eclectic style of therapy for people who are anxious or depressed, or who want to grow in their personal and professional lives. He has trained and supervised therapists who have established successful practices. Dr. Pierce is a leading ex-pert in consultation and education in the basic science and use of medications affecting moods, anxiety, and thinking. He regularly provides educational presentations to primary care physicians, psychiatrists, and other psychology professionals and currently serves as consultant, educational speaker and clinical investigator for several pharmaceutical companies. Dr. Pierce is a diplomate of the American Board of Psychiatry and Neurology and of the American Academy of Pain Management. He is one of a small number of psychiatrists receiving Board Certification in Administrative Psychiatry by the American Psychiatric Association, and one of a very small number of psychiatrists to be certified as a Master Psychopharmacol-ogist by the Neuroscience Education Institute. Dr. Pierce is certified by the American Board of Forensic Examiners and frequently provides expert witness court testimony. He has been the invited Grand Rounds presenter at many San Francisco area hospitals.\r\n<blockquote><b>Date:</b> Thursday, August 9, 2018\r\n\r\n<b>Time:</b> Check-In: 11:45 am; Presentation: 12:00—1:00 pm\r\n\r\n<b>Presenter(s):</b> Barry G. Pierce, M.D.\r\n\r\n<b>MCLE:</b> 1.0 Unit Participatory Credit in Competence Issues\r\n\r\n<b>Place:</b> SCBA Office, 111 Santa Rosa Ave., Ste. 222, Santa Rosa, CA 95404.\r\n<b>Parking for this seminar is ONLY available in the Public Parking Garage at 555 First Street. <u>Do not park in the parking lot at 111 Santa Rosa Avenue.</u></b>\r\n\r\n<b>Registration Fee:</b> $60–SCBA Members; $75–Public;\r\n\r\n<strong>Student:</strong> $20 (The student discount is now available online for SCBA Student Members. Students who are not members of SCBA may utilize the student discount by downloading the registration form and submitting it with proof of current enrollment to the SCBA Offices. For more information on becoming a member of SCBA, please contact Susan Demers at (707) 542-1190 ext. 18.)\r\n\r\n<a href=\"https://www.sonomacountybar.org/controller.cfm?view=public.event_detail&amp;cid=2CBAFA4E-A44A-B71C-E2E2AB8CF879F88D\">Click Here to Register</a>\r\n<a href=\"https://www.sonomacountybar.org/wp-content/uploads/2018/05/2018-08-09-Stress-Anxiety-Depression.pdf\">Click Here to Download the Registration Flyer</a></blockquote>\r\n</div>','Stress, Anxiety, and Depression in the Legal Profession','','publish','closed','closed','','stress-anxiety-and-depression-in-the-legal-profession','','','2018-06-20 21:01:05','2018-06-21 03:01:05','',0,'http://development.local/shop/uncategorized/stress-anxiety-and-depression-in-the-legal-profession/',0,'product','',0),(3925,1,'2019-01-17 13:38:45','2019-01-17 20:38:45','','Stress, Anxiety, and Depression in the Legal Profession 1','','inherit','open','closed','','stress-anxiety-and-depression-in-the-legal-profession-1','','','2019-01-17 13:38:45','2019-01-17 20:38:45','',3924,'http://development.local/wp-content/uploads/2019/01/depression.jpg',0,'attachment','image/jpeg',0),(4961,70,'2018-08-05 21:54:13','2018-08-06 03:54:13','Description','LRS Application Packet','','publish','closed','closed','','lrs-application-packet','','','2018-08-05 21:54:13','2018-08-06 03:54:13','',0,'http://development.local/shop/uncategorized/lrs-application-packet/',0,'product','',0),(4992,70,'2018-08-06 21:05:04','2018-08-07 03:05:04','','Guidelines & Rules for Arbitrators, Revised on Nov. 21, 2016','Document','publish','closed','closed','','guidelines-rules-for-arbitrators-revised-on-nov-21-2016','','','2018-08-06 21:05:04','2018-08-07 03:05:04','',0,'http://development.local/shop/uncategorized/guidelines-rules-for-arbitrators-revised-on-nov-21-2016/',0,'product','',0),(4998,70,'2018-08-06 21:12:49','2018-08-07 03:12:49','','Notice of Fee Arbitration Hearing','Form','publish','closed','closed','','notice-of-fee-arbitration-hearing','','','2018-08-06 21:12:49','2018-08-07 03:12:49','',0,'http://development.local/shop/uncategorized/notice-of-fee-arbitration-hearing/',0,'product','',0),(5000,70,'2018-08-06 21:14:24','2018-08-07 03:14:24','','Stipulation to Binding Arbitration','Form','publish','closed','closed','','stipulation-to-binding-arbitration','','','2018-08-06 21:14:24','2018-08-07 03:14:24','',0,'http://development.local/shop/uncategorized/stipulation-to-binding-arbitration/',0,'product','',0),(5004,70,'2018-08-06 21:17:08','2018-08-07 03:17:08','','Proof of Service by Mail','Form','publish','closed','closed','','pro