://development.local/shop/uncategorized/refund-request-form/',0,'product','',0),(5513,70,'2018-09-10 17:40:54','2018-09-10 23:40:54','<div class=\"post-headline\">\r\n<h1>Legislative Updates in Labor &amp; Employment for 2019</h1>\r\n</div>\r\n<div class=\"post-byline\">Published September 6th, 2018</div>\r\n<div class=\"post-bodycopy clearfix\"><center>Last year’s “#Me too” movement, decisions by the U.S. and California Supreme Court on the validity of arbitration clauses, and continuing efforts to clarify the calculation of wages have resulted in a passel of proposed employment legislation in 2018 for the future. Join the Labor and Employment Law Section in discussion of laws signed by the Governor for 2019, as well as new regulations affecting labor and employment issues.</center><a href=\"https://www.sonomacountybar.org/wp-content/uploads/2013/09/Bader-Valorie-Presenter-Photo.jpg\"><img class=\"alignleft size-thumbnail wp-image-8505\" src=\"https://www.sonomacountybar.org/wp-content/uploads/2013/09/Bader-Valorie-Presenter-Photo-150x150.jpg\" alt=\"bader-valorie-presenter-photo\" width=\"150\" height=\"150\" /></a>\r\n<strong>Valorie Bader</strong>\r\nWelty/Welty, PCMs. Bader has been practicing 30 years in the areas of employment and business counseling, training, mechanic liens, and employment litigation. Her current practice includes sexual harassment training and other trainings, investigations, mediation and arbitration, as well as other alternatives for conflict resolution. Ms. Bader continues to counsel businesses and individuals and litigates in court and before administrative agencies such as the Labor Commissioner, the Employment Development Department, the Workers Compensation Appeals Board, Cal-OSHA, the Department of Fair Employment and Housing/ Equal Employment Opportunity Commission, CA Department of Licensing, CA Department of Insurance, Cal-PERS and other Retirement Associations and before the California State Personnel Board and other public entities. Ms. Bader has performed numerous workshops and trainings for the Personnel Perspective, Lorman Business Seminars and the Personnel Association of Sonoma County (PASCO), in diverse topics related to employment issues and has taught specific employment law classes for the Santa Rosa Junior College. She has also written extensively in the subjects of employment law, and appeared in the Sonoma Business Journal and the Press Democrat.\r\n<blockquote><b>Date:</b> Monday, December 3, 2018\r\n\r\n<b>Time:</b> Check-In: 11:45 am; Presentation: 12:00—1:00 pm\r\n\r\n<b>Presenter(s):</b> Valorie Bader, Welty/Welty, PC\r\n\r\n<b>Place:</b> SCBA Office, 111 Santa Rosa Ave., Ste. 222, Santa Rosa, CA 95404.\r\n<strong>Parking for this seminar is ONLY available in the Public Parking Garage at 555 First Street. <u>Do not park in the parking lot at 111 Santa Rosa Avenue.</u></strong>\r\n\r\n<b>MCLE:</b> 1 Unit Participatory MCLE Credit in General Law\r\n\r\n<b>Registration Fee:</b> $60–SCBA Members; $70–Public;\r\n\r\n<strong>Student:</strong> $20 (The student discount is now available online for SCBA Student Members. Students who are not members of SCBA may utilize the student discount by downloading the registration form and submitting it with proof of current enrollment to the SCBA Offices. For more information on becoming a member of SCBA, please contact Susan Demers at (707) 542-1190 ext. 18.)\r\n\r\n<a href=\"https://www.sonomacountybar.org/controller.cfm?view=public.event_detail&amp;cid=DC4519B4-5056-A62A-66533542AB183529\">Click Here to Register</a>\r\n<a href=\"https://www.sonomacountybar.org/wp-content/uploads/2018/09/2018-12-03-Legislative-Updates-in-LE-WEB.pdf\">Click Here to Download the Registration Flyer</a></blockquote>\r\n</div>\r\n<div class=\"post-footer\">September 6th, 2018 | Category: <a href=\"https://www.sonomacountybar.org/?cat=67\" rel=\"category\">General Law</a>, <a href=\"https://www.sonomacountybar.org/?cat=86\" rel=\"category\">Labor &amp; Employment Section</a>, <a href=\"https://www.sonomacountybar.org/?cat=4\" rel=\"category\">MCLE Classes</a></div>','Legislative Updates in Labor & Employment for 2019','<h3>Join the Labor and Employment Law Section in discussion of laws signed by the Governor for 2019.  Presented by Valorie Bader.  <a href=\"https://scba7.wilcoxdigital.org/product/legislative-updates-in-labor-employment-for-2019\">Read More ...</a></h3>','publish','closed','closed','','legislative-updates-in-labor-employment-for-2019','','','2018-09-10 17:40:54','2018-09-10 23:40:54','',0,'http://development.local/shop/uncategorized/legislative-updates-in-labor-employment-for-2019/',0,'product','',0),(5538,70,'2018-09-10 21:05:26','2018-09-11 03:05:26','<div class=\"post-headline\">\r\n<h1>Introduction to Easement Law</h1>\r\n</div>\r\n<div class=\"post-byline\">Published August 27th, 2018</div>\r\n<div class=\"post-bodycopy clearfix\"><center>\r\n<a href=\"https://www.sonomacountybar.org/wp-content/uploads/2018/08/Pavone-Daniella.jpg\"><img class=\"alignleft size-thumbnail wp-image-10509\" src=\"https://www.sonomacountybar.org/wp-content/uploads/2018/08/Pavone-Daniella-150x150.jpg\" alt=\"Pavone, Daniella\" width=\"150\" height=\"150\" /></a>\r\n<p align=\"Left\"><strong>Daniela M. Pavone</strong>\r\nZimmerman Pavone LLP</p>\r\nMs. Pavone’s practice centers on land use and real estate law. She has a great deal of experience in handling contract disputes, landlord/tenant issues, and an array of easement and property line disputes. Ms. Pavone is a graduate of Chapman University School of Law in the City of Orange. She graduated in 2007 with an emphasis in environmental, land use, and real estate law. Ms. Pavone has served as Chair of the Sonoma County Commission on the Status of Women and is a member of the Sonoma County Bar Association and Business Networkers International. She is also a fellow of the Leadership Institute for Ecology and the Economy and a graduate of Leadership Mendocino.\r\n\r\n<a href=\"https://www.sonomacountybar.org/wp-content/uploads/2018/08/Olsan-Jeremy-2016-Directory.jpg\"><img class=\"alignleft size-thumbnail wp-image-10510\" src=\"https://www.sonomacountybar.org/wp-content/uploads/2018/08/Olsan-Jeremy-2016-Directory-150x150.jpg\" alt=\"Olsan, Jeremy - 2016 Directory\" width=\"150\" height=\"150\" /></a>\r\n<p align=\"Left\"><strong>Jeremy L. Olsan</strong>\r\nPerry, Johnson, Anderson, Miller &amp; Moskowitz, LLP</p>\r\nJEREMY OLSAN is a partner in the firm of PERRY, JOHNSON, ANDERSON, MILLER &amp; MOSKOWITZ, LLP.\r\n\r\nEducation and Experience:\r\nThe California State Bar Board of Trustees recently appointed Jeremy to the Executive Committee of the State Bar Real Property Law Section. He is an AV Preeminent® Peer Review Rated attorney*, and he is recognized by his peers as a Super Lawyer® of Northern California. He graduated from UC Berkeley and from McGeorge School of Law at the University of the Pacific, where he was on the Board of Editors of the Pacific Law Journal. Before law school, he was a commercial real estate agent, and served as the Executive Director of the California State Senate Advisory Commission on Cost Control in State Government.\r\n\r\nJeremy has negotiated and documented many significant real estate and business transactions, including purchases, sales, leasing and construction of shopping centers, office buildings, wineries, vineyards, ranches, development and subdivision land, estate homes, conservation and other easements. He also practices in the area of business entity formation and governance, business sales, mergers and acquisitions, construction law, land use, zoning and planning. Some of his notable real estate and development transactions include: representing the Sonoma Land Trust in the single largest conservation land acquisition in Sonoma County history; representing Codding Enterprises in its sale of a tenancy in common interest in Coddingtown Mall to Simon Property Group; representing the private seller of a 27,000-acre, 250+ parcel ranch; and representation of the Sonoma State University Academic Foundation in the financing and development of the Green Music Center. Jeremy represents for-profit and nonprofit businesses, academic institutions, and homeowners’ associations in corporate, governance, and real estate matters. His practice includes representing real estate brokerage firms and associations of REALTORS® regarding corporate and disclosure issues and broker risk management. Jeremy also assists clients who are negotiating with governmental agencies in real estate transactions, including condemnation-related matters.\r\n\r\nRepresentative Clients:\r\nJeremy has represented private individuals, business of all kinds, non-profit corporations, and academic and governmental institutions, including the Sonoma Land Trust, Codding Enterprises, Korbel Champagne Cellars, Siduri Wines, Copain Wine Cellars, Summit State Bank, Sonoma State University Academic Foundation, Sonoma\r\nState Enterprises, Audubon Canyon Ranch, Prudential California Realty, Manor Development Company, the City of Santa Rosa, and the North Bay, Marin, and Oakland/Berkeley Associations of REALTORS®. He is frequently called on to lecture to and consult with real estate industry groups and brokers on transactional and disclosure issues, broker risk management, and on broker discipline and arbitration hearings. He is a regular participant in the California Association of REALTORS®’ Legal Affairs Forums, and participates in the development of the statewide Association’s real estate contract forms that are the gold standard in California.\r\n\r\nCommunity Leadership:\r\nJeremy is an active community volunteer and leader. He is currently a member of the Board of Directors of the Redwood Empire Food Bank, and is the past president of the Santa Rosa Downtown Market, was a longtime Board member and Executive Committee Member at the Volunteer Center of Sonoma County, and past president of Santa Rosa’s Reform Jewish Congregation Shomrei Torah. Jeremy also provides pro bono legal services for the Sonoma County Bicycle Coalition, the Ceres Community Project, and other local non-profits, and he has volunteered as a pro bono arbitrator for the Sonoma County Superior Court since 1996.\r\n\r\n* AV®, BV®, AV Preeminent® and BV Distinguished® are registered certification marks of Reed Elsevier Properties Inc., used under in accordance with the Martindale-Hubbell certification procedures, standards and policies. Martindale-Hubbell is the facilitator of a peer review rating process. Ratings reflect the anonymous opinions of members of the bar and the judiciary. Martindale-Hubbell® Peer Review Ratings™ fall into two categories – legal ability and general ethical standards.\r\n\r\n<a href=\"https://www.sonomacountybar.org/wp-content/uploads/2018/06/Berry-David-edited.jpg\"><img class=\"alignright size-thumbnail wp-image-10357\" src=\"https://www.sonomacountybar.org/wp-content/uploads/2018/06/Berry-David-edited-150x150.jpg\" alt=\"Berry, David edited\" width=\"150\" height=\"150\" /></a>\r\n<p align=\"RIGHT\"><strong>David W. Berry</strong>\r\nAbbey, Weitzenberg, Warren &amp; Emery, P.C.</p>\r\nMr. Berry is an accomplished trial lawyer whose practice is largely focused on resolving construction defect, real estate, business, elder abuse, trust, and probate disputes. He has spent many years representing homeowners and commercial building owners resolve construction defect claims. Known for his approachable manner and tireless devotion to the success of his clients, he obsesses with distilling complex disputes into simple themes. He is a long-time shareholder at Abbey, Weitzenberg, Warren &amp; Emery, LLP.\r\n\r\n</center>\r\n<blockquote><b>Date:</b> Thursday, November 29, 2018\r\n\r\n<b>Time:</b> Check-In: 11:45 am; Presentation: 12:00—1:00 pm\r\n\r\n<b>Presenter(s):</b>\r\nDaniela M. Pavone\r\nZimmerman Pavone LLP\r\n\r\nJeremy L. Olsan\r\nPerry, Johnson, Anderson, Miller &amp; Moskowitz, LLP\r\n\r\nDavid W. Berry\r\nAbbey, Weitzenberg, Warren &amp; Emery, P.C.\r\n\r\n<b>Place:</b> SCBA Office, 111 Santa Rosa Ave., Ste. 222, Santa Rosa, CA 95404.\r\n<b>Parking for this seminar is ONLY available in the Public Parking Garage at 555 First Street. <u>Do not park in the parking lot at 111 Santa Rosa Avenue.</u></b>\r\n\r\n<b>MCLE:</b> 1.0 Unit Participatory Credit in General Law\r\n\r\n<b>Registration Fee:</b> $60–SCBA Members; $75–Public;\r\n<strong>Student:</strong> $20 (The student discount is now available online for SCBA Student Members. Students who are not members of SCBA may utilize the student discount by downloading the registration form and submitting it with proof of current enrollment to the SCBA Offices. For more information on becoming a member of SCBA, please contact Susan Demers at (707) 542-1190 ext. 18.)\r\n\r\n<a href=\"https://www.sonomacountybar.org/wp-content/uploads/2018/08/2018-11-29-Intro-to-Easement-Law.pdf\">Click Here to Download the Registration Flyer</a></blockquote>\r\n</div>','Introduction to Easement Law','Presented by Daniela M. Pavone, Jeremy L. Olsen, and David W. Berry.   <a href=\"https://scba7.wilcoxdigital.org/product/introduction-to-easement-law\">Read More...</a>','publish','closed','closed','','introduction-to-easement-law','','','2018-09-10 21:05:26','2018-09-11 03:05:26','',0,'http://development.local/shop/uncategorized/introduction-to-easement-law/',0,'product','',0),(5572,70,'2018-09-11 17:32:45','2018-09-11 23:32:45','<div class=\"post-headline\">\r\n<h1>Fiduciary Income Tax Returns 101</h1>\r\n</div>\r\n<div class=\"post-byline\">Published August 27th, 2018</div>\r\n<div class=\"post-bodycopy clearfix\" style=\"text-align: left;\"><center>Ms. Fritsche will discuss estate income tax returns and how they differ from trust income tax returns. She will review the different types of reporting trusts and provide a general overview of taxation. There will also be a discussion on selected topics related to fiduciary income tax returns, including the effect of the recent Tax Cuts and Jobs Act.</center><a href=\"https://www.sonomacountybar.org/wp-content/uploads/2018/08/Fritsche-Joni.jpg\"><img class=\"aligncenter size-thumbnail wp-image-10505\" src=\"https://www.sonomacountybar.org/wp-content/uploads/2018/08/Fritsche-Joni-150x150.jpg\" alt=\"Fritsche, Joni\" width=\"150\" height=\"150\" /></a>\r\n\r\n<center><strong>Joni Fritsche, CPA, AEP</strong>\r\nManaging Director, Tax\r\nBurr Pilger Mayer, Inc.Ms. Fritsche has thirty-four years of CPA firm tax and accounting experience. Her practice is currently focused on the areas of estate and trust planning, administration, and taxation. Ms. Fritsche works closely with attorneys, private fiduciaries, executors, closely-held business owners and private client services to oversee the orderly transfer of assets to beneficiaries, taking into consideration the tax aspects of such holdings and transfers. She also provides tax advisory services to high net-worth individuals.</center>&nbsp;\r\n<blockquote><b>Date:</b> Friday, November 16, 2018\r\n\r\n<b>Time:</b> Check-In: 11:45 am; Presentation: 12:00—1:00 pm\r\n\r\n<b>Presenter(s):</b> <strong>\r\nJoni Fritsche, CPA, AEP, </strong>Managing Director, Tax\r\nBurr Pilger Mayer, Inc.\r\n\r\n<b>Place:</b> SCBA Office, 111 Santa Rosa Ave., Ste. 222, Santa Rosa, CA 95404.\r\n<b>Parking for this seminar is ONLY available in the Public Parking Garage at 555 First Street. <u>Do not park in the parking lot at 111 Santa Rosa Avenue.</u></b>\r\n\r\n<b>MCLE:</b> 1.0 Unit Participatory Credit in General Law\r\n\r\n<b>Registration Fee:</b> $60–SCBA Members; $75–Public;\r\n\r\n<strong>Student:</strong> $20 (The student discount is now available online for SCBA Student Members. Students who are not members of SCBA may utilize the student discount by downloading the registration form and submitting it with proof of current enrollment to the SCBA Offices. For more information on becoming a member of SCBA, please contact Susan Demers at (707) 542-1190 ext. 18.)\r\n\r\n<a href=\"https://www.sonomacountybar.org/controller.cfm?view=public.event_detail&amp;cid=E84888CA-C917-D57B-BC96E5EF4EA30F59\">Click Here to Register</a>\r\n<a href=\"https://www.sonomacountybar.org/wp-content/uploads/2018/08/2018-11-16-Fiduciary-Income-Tax-Returns.pdf\">Click Here to Download the Registration Flyer</a></blockquote>\r\n</div>','Fiduciary Income Tax Returns','Presented by Joni Fritsche.  Ms. Fritsche will discuss estate income tax returns and how they differ from trust income tax returns.  <a href=\"https://scba7.wilcoxdigital.org/product/fiduciary-income-tax-returns\">Read More ...</a>','publish','closed','closed','','fiduciary-income-tax-returns','','','2018-09-11 17:32:45','2018-09-11 23:32:45','',0,'http://development.local/shop/uncategorized/fiduciary-income-tax-returns/',0,'product','',0),(5578,70,'2018-09-11 19:12:21','2018-09-12 01:12:21','<div class=\"post-headline\">\r\n<h1>Competent to Stand Trial?</h1>\r\n</div>\r\n<div class=\"post-byline\">Published August 17th, 2018</div>\r\n<center><span style=\"font-size: small;\"><b>Issues Related to California Penal Code 1368 &amp; 1370</b></span></center>\r\n<h4 class=\"post-bodycopy clearfix\" style=\"text-align: center;\">This Presentation will cover:</h4>\r\n<center>~ The Statutory Framework of 1368 et seq.\r\nBefore the doubt:\r\n~ The Prosecutor’s Role in Competency Proceedings.\r\n~ Defense Counsel’s Role: Identifying Competency Issues/Representing the Incompetent Client.\r\nAfter the doubt:\r\n~ Placement: Outpatient, Jail Based Competency, and State Hospitals\r\n~ Restoration Proceedings: Medication, Treatment, and Non-Restorability.</center>\r\n<table>\r\n<tbody>\r\n<tr class=\"alt\">\r\n<td><center><strong>Anne Masterson</strong>\r\nChief Deputy District Attorney\r\nSonoma County District Attorney’s Office</center></td>\r\n<td><center><strong>Emily Mann, LMFT</strong>\r\nCalifornia Forensic Medical Group, Inc.</center></td>\r\n</tr>\r\n<tr>\r\n<td><center><strong>Alexa Stone, LCSW</strong>\r\nBehavioral Health Clinician\r\nSonoma County Department of Health Services</center></td>\r\n<td><center><strong>Lynne Stark-Slater</strong>\r\nChief Deputy Public Defender\r\nSonoma County Public Defender’s Office</center></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n<blockquote><b>Date:</b> Tuesday, November 6, 2018\r\n\r\n<b>Time:</b> Check-In: 11:45 am; Presentation: 12:00—1:00 pm\r\n\r\n<b>Presenter(s):</b>\r\n<strong>Anne Masterson,</strong> Chief Deputy District Attorney\r\nSonoma County District Attorney’s Office\r\n\r\n<strong>Alexa Stone,</strong> LCSW, Behavioral Health Clinician\r\nSonoma County Department of Health Services\r\n\r\n<strong>Emily Mann, LMFT</strong>\r\nCalifornia Forensic Medical Group, Inc.\r\n\r\n<strong>Lynne Stark-Slater,</strong> Chief Deputy Public Defender\r\nSonoma County Public Defender’s Office\r\n\r\n<b>Place:</b> SCBA Office, 111 Santa Rosa Ave., Ste. 222, Santa Rosa, CA 95404.\r\n<b><u>NOTE:</u> Parking for this seminar is ONLY available in the Public Parking Garage at 555 First Street.\r\n<u>Do not park in the parking lot at 111 Santa Rosa Avenue.</u></b>\r\n\r\n<b>MCLE:</b> 1.0 Unit Participatory Credit in General Law\r\n\r\n<b>Registration Fee:</b> $60–SCBA Members; $75–Public;\r\n\r\n<strong>Student:</strong> $20 (The student discount is now available online for SCBA Student Members. Students who are not members of SCBA may utilize the student discount by downloading the registration form and submitting it with proof of current enrollment to the SCBA Offices. For more information on becoming a member of SCBA, please contact Susan Demers at (707) 542-1190 ext. 18.)\r\n\r\n<a href=\"https://www.sonomacountybar.org/wp-content/uploads/2018/08/2018-11-06-1368-1370-Issues-WEB.pdf\">Click Here to Download the Registration Flyer</a></blockquote>','Competent to Stand Trial?','Issues Related to California Penal Code 1368 &amp; 1370.   <a href=\"https://scba7.wilcoxdigital.org/product/competent-to-stand-trial\">Read More ...</a>','publish','closed','closed','','competent-to-stand-trial','','','2018-09-11 19:12:21','2018-09-12 01:12:21','',0,'http://development.local/shop/uncategorized/competent-to-stand-trial/',0,'product','',0),(5582,70,'2018-09-11 19:28:16','2018-09-12 01:28:16','<div class=\"post-headline\">\r\n<h1>Post-Judgmnt Spousal Support</h1>\r\n</div>\r\n<div class=\"post-byline\">Published August 3rd, 2018</div>\r\n<div class=\"post-bodycopy clearfix\"><center><span style=\"font-size: small;\">And Issues that Arise When Parties\r\nReach Retirement Age</span></center><a href=\"https://www.sonomacountybar.org/wp-content/uploads/2013/08/Bertoli-James-Hon..jpg\"><img class=\"alignright size-thumbnail wp-image-4885\" src=\"https://www.sonomacountybar.org/wp-content/uploads/2013/08/Bertoli-James-Hon.-150x150.jpg\" alt=\"Bertoli, James (Hon.)\" width=\"150\" height=\"150\" /></a>\r\n<p align=\"RIGHT\"><strong>Hon. James G. Bertoli</strong>, Sonoma County Superior Court</p>\r\nThe Honorable James G. Bertoli is currently assigned to the Family Law Division of the Sonoma County Superior Court and has been a member of the Sonoma County bench for 17 years. In addition to general family law cases and LPS conservatorships, Judge Bertoli has sat as the judge handling both civil and criminal domestic violence cases for over eight years. In addition to his duties on the bench, Judge Bertoli has served on the Sonoma County Superior Court Executive Committee, the governing and policy-making body for the court and has served as the supervising judge for the Family Law\r\nDivision. A fourth-generation native of Sonoma County, Judge Bertoli was educated at Santa Rosa Junior College and received his Bachelor’s Degree in Economics in 1982 from the University of California at Davis. He received his Juris Doctorate from the University of San Francisco in 1985 and began practicing family law and public sector labor law with the Santa Rosa, California law firm of Wotring &amp; Byrne. He then became the managing partner of the law firm of Byrne &amp; Bertoli in 1989 and then formed a solo practice in 1991 which he maintained until his election to the bench in November, 2000.\r\n\r\n<a href=\"https://www.sonomacountybar.org/wp-content/uploads/2018/08/Lewis-Roger.jpg\"><img class=\"alignleft size-thumbnail wp-image-10451\" src=\"https://www.sonomacountybar.org/wp-content/uploads/2018/08/Lewis-Roger-150x150.jpg\" alt=\"Lewis, Roger\" width=\"150\" height=\"150\" /></a>\r\n<strong>Roger J. Lewis</strong>, Esq., ADR Services, Inc.\r\n\r\nAfter 40 years of traditional family law practice, Mr. Lewis now limits his practice to family law mediation and private dispute resolution. He has conducted numerous mediations and privately adjudicated many family law matters. Mr. Lewis has been certified as a specialist in family law by the State Bar of California’s Board of Legal Specialization since 1995. Mr. Lewis has extensive practice experience in all facets of family law, including business valuation and apportionment, tracing, complicated real estate and property division issues, transmutation, premarital and marital agreements, child and spousal support disputes, post-trial matters, modification of support, and parenting issues. Mr. Lewis has been a frequent lecturer on family law issues throughout California for many years. This has included seminars for Continuing Education of the Bar (CEB) and with Garrett Dailey of Attorney’s Briefcase, and multiple presentations to bar groups over the years, including recent presentations concerning family law real estate issues; retirement of the Baby Boomers and resulting spousal support modification; and best practices in alternative dispute resolution.\r\n<blockquote><b>Date:</b> Tuesday, October 23, 2018\r\n\r\n<b>Time:</b> Check-In: 2:45 pm; Presentation: 3:00—5:00 pm\r\n\r\n<b>Presenter(s):</b>\r\n<strong>Hon. James G. Bertoli</strong>, Sonoma County Superior Court\r\n<strong>Roger J. Lewis</strong>, Esq., ADR Services, Inc.\r\n\r\n<b>Place:</b> SCBA Office, 111 Santa Rosa Ave., Ste. 222, Santa Rosa, CA 95404.\r\n<strong>Parking for this seminar is ONLY available in the Public Parking Garage at 555 First Street. <u>Do not park in the parking lot at 111 Santa Rosa Avenue.</u></strong>\r\n\r\n<b>MCLE:</b> 2.0 Units Participatory Credit in General Law\r\n\r\n<b>Registration Fee:</b> $80–SCBA Members; $95–Public;\r\n\r\n<strong>Student:</strong> $20 (The student discount is now available online for SCBA Student Members. Students who are not members of SCBA may utilize the student discount by downloading the registration form and submitting it with proof of current enrollment to the SCBA Offices. For more information on becoming a member of SCBA, please contact Susan Demers at (707) 542-1190 ext. 18.)\r\n\r\n<a href=\"https://www.sonomacountybar.org/controller.cfm?view=public.event_detail&amp;cid=039FBA86-A44A-B71C-E27C51ABEA5DC9F6\">Click Here to Register</a>\r\n<a href=\"https://www.sonomacountybar.org/wp-content/uploads/2018/08/2018-10-23-Post-Judgment-Spousal-Support.pdf\">Click Here to Download the Registration Flyer</a></blockquote>\r\n</div>','Post-Judgment Spousal Support','Issues that Arise When Parties Reach Retirement Age.  <a href=\"https://scba7.wilcoxdigital.org/product/post-judgement-spousal-support\">Read More ...</a>','publish','closed','closed','','post-judgment-spousal-support','','','2018-09-11 19:28:16','2018-09-12 01:28:16','',0,'http://development.local/shop/uncategorized/post-judgment-spousal-support/',0,'product','',0),(5589,70,'2018-09-11 20:30:13','2018-09-12 02:30:13','<div class=\"post-headline\">\r\n<h1>2018 Careers of Distinction Awards Dinner</h1>\r\n</div>\r\n<div class=\"post-byline\">Published March 21st, 2018</div>\r\n<div class=\"post-bodycopy clearfix\">\r\n<h4><strong>Please join SCBA on Friday, October 19, 2018 to honors this year’s Careers of Distinction Award Nominees.</strong></