e join SCBA on Friday, October 19, 2018 to honors this year’s Careers of Distinction Award Nominees.  <a href=\"https://scba7.wilcoxdigital.org/product/2018-careers-of-distinction-awards-dinner\">Read More ...</a>','publish','closed','closed','','2018-careers-of-distinction-awards-dinner','','','2018-09-11 20:30:13','2018-09-12 02:30:13','',0,'http://development.local/shop/uncategorized/2018-careers-of-distinction-awards-dinner/',0,'product','',0),(5631,70,'2018-09-18 19:34:28','2018-09-19 01:34:28','<div class=\"post-headline\">\r\n<h1>29th Annual Pro Bono Awards</h1>\r\n</div>\r\n<div class=\"post-byline\">Published March 3rd, 2018</div>\r\n<div class=\"post-bodycopy clearfix\">\r\n<h3>and SCBA General Membership Meeting</h3>\r\n<a href=\"https://www.sonomacountybar.org/wp-content/uploads/2018/08/2018-11-01-Pro-Bono-Awards.jpg\"><img class=\"aligncenter size-full wp-image-10456\" src=\"https://www.sonomacountybar.org/wp-content/uploads/2018/08/2018-11-01-Pro-Bono-Awards.jpg\" sizes=\"(max-width: 1275px) 100vw, 1275px\" srcset=\"https://www.sonomacountybar.org/wp-content/uploads/2018/08/2018-11-01-Pro-Bono-Awards.jpg 1275w, https://www.sonomacountybar.org/wp-content/uploads/2018/08/2018-11-01-Pro-Bono-Awards-232x300.jpg 232w, https://www.sonomacountybar.org/wp-content/uploads/2018/08/2018-11-01-Pro-Bono-Awards-768x994.jpg 768w, https://www.sonomacountybar.org/wp-content/uploads/2018/08/2018-11-01-Pro-Bono-Awards-791x1024.jpg 791w, https://www.sonomacountybar.org/wp-content/uploads/2018/08/2018-11-01-Pro-Bono-Awards-116x150.jpg 116w, https://www.sonomacountybar.org/wp-content/uploads/2018/08/2018-11-01-Pro-Bono-Awards-400x518.jpg 400w\" alt=\"2018-11-01 Pro Bono Awards\" width=\"1275\" height=\"1650\" /></a>\r\n<blockquote><b>Date:</b> Thursday, November 1, 2018\r\n\r\n<b>Time:</b> Registration: 3:30 pm | Program: 4:00 pm | Reception: 5:30 pm\r\n\r\n<b>Place:</b> Hyatt Regency Sonoma Wine Country, 170 Railroad Street, Santa Rosa\r\n\r\n<b>Registration Fee:</b> $70 per person\r\n<b>NOTE: The Hyatt is now charging $10.00 per day for parking and is included in your registration fee provided you have your parking receipt validated at the SCBA registration desk before you leave the seminar.</b>\r\n\r\n<a href=\"https://www.sonomacountybar.org/wp-content/uploads/2018/08/2018-11-01-Pro-Bono-Awards.pdf\">Click Here to Download the Registration Flyer</a></blockquote>\r\n</div>','29th Annual Pro Bono Awards','<h3>This is where a \"short description\" goes.</h3>\r\n&nbsp;\r\n\r\n&nbsp;','publish','closed','closed','','29th-annual-pro-bono-awards','','','2018-09-18 19:34:28','2018-09-19 01:34:28','',0,'http://development.local/shop/uncategorized/29th-annual-pro-bono-awards/',0,'product','',0),(5632,1,'2019-01-17 13:39:37','2019-01-17 20:39:37','','29th Annual Pro Bono Awards 1','','inherit','open','closed','','29th-annual-pro-bono-awards-1','','','2019-01-17 13:39:37','2019-01-17 20:39:37','',5631,'http://development.local/wp-content/uploads/2019/01/pro-bono.jpg',0,'attachment','image/jpeg',0),(5646,70,'2018-09-19 09:52:38','2018-09-19 15:52:38','<div class=\"post-headline\">\r\n<h1>The Right to Repair Act and Wildfire Reconstruction</h1>\r\n</div>\r\n<div class=\"post-byline\">Published June 27th, 2018</div>\r\n<div class=\"post-bodycopy clearfix\"><center><span style=\"font-size: xx-small;\">In January 2018, the California Supreme Court held that SB 800 is a homeowner’s exclusive remedy to resolve claimed construction defects. James Beyers, who represents contractors, and David Berry, who represents homeowners, will provide a roadmap to construction dispute resolution.</span></center><a href=\"https://www.sonomacountybar.org/wp-content/uploads/2018/06/Berry-David-edited.jpg\"><img class=\"alignright size-thumbnail wp-image-10357\" src=\"https://www.sonomacountybar.org/wp-content/uploads/2018/06/Berry-David-edited-150x150.jpg\" alt=\"Berry, David edited\" width=\"150\" height=\"150\" /></a>\r\n<p align=\"RIGHT\"><strong>David W. Berry</strong>, Abbey, Weitzenberg, Warren &amp; Emery, P.C.</p>\r\nMr. Berry is an accomplished trial lawyer whose practice is largely focused on resolving construction defect, real estate, business, elder abuse, trust, and probate disputes. He has spent many years representing homeowners and commercial building owners resolve construction defect claims. Known for his approachable manner and tireless devotion to the success of his clients, he obsesses with distilling complex disputes into simple themes. He is a long-time shareholder at\r\nAbbey, Weitzenberg, Warren &amp; Emery, LLP.\r\n\r\n<a href=\"https://www.sonomacountybar.org/wp-content/uploads/2018/06/Beyers-James-edited.jpg\"><img class=\"alignleft size-thumbnail wp-image-10355\" src=\"https://www.sonomacountybar.org/wp-content/uploads/2018/06/Beyers-James-edited-150x150.jpg\" alt=\"Beyers, James edited\" width=\"150\" height=\"150\" /></a>\r\n<strong>James L. Beyers</strong>, Beyers Costin Simon\r\n\r\nMr. Beyers has been a partner at Beyers Costin Simon since 1975. Well known for his expertise in real estate, land use and regulatory law, he has represented numerous commercial and residential developers, contractors and property owners throughout Northern California. His work includes property acquisitions, financing, construction and environmental compliance. With over four decades of experience, Mr. Beyers brings a high degree of pragmatism, creativity, and problem solving in representing his clients’ interests.\r\n<blockquote><b>Date:</b> Thursday, September 20, 2018\r\n\r\n<b>Time:</b> Check-In: 11:45 am; Presentation: 12:00—1:00 pm\r\n\r\n<b>Presenter(s):</b>\r\n<strong>David W. Berry</strong>, Abbey, Weitzenberg, Warren &amp; Emery, P.C.\r\n<strong>James L. Beyers</strong>, Beyers Costin Simon\r\n\r\n<b>MCLE:</b> 1.0 Unit Participatory Credit in General Law\r\n\r\n<b>Place:</b> SCBA Office, 111 Santa Rosa Ave., Ste. 222, Santa Rosa, CA 95404.\r\n<strong>Parking for this seminar is ONLY available in the Public Parking Garage at 555 First Street. <u>Do not park in the parking lot at 111 Santa Rosa Avenue.</u></strong>\r\n\r\n<b>Registration Fee:</b> $60–SCBA Members; $75–Public;\r\n\r\n<strong>Student:</strong> $20 (The student discount is now available online for SCBA Student Members. Students who are not members of SCBA may utilize the student discount by downloading the registration form and submitting it with proof of current enrollment to the SCBA Offices. For more information on becoming a member of SCBA, please contact Susan Demers at (707) 542-1190 ext. 18.)\r\n\r\n<a href=\"https://www.sonomacountybar.org/wp-content/uploads/2018/06/2018-09-20-Right-to-Repair-Act-Wildfire-Reconstruction.pdf\">Click Here to Download the Registration Flyer</a></blockquote>\r\n</div>','The Right to Repair Act and Wildfire Reconstruction','Short Description','publish','closed','closed','','the-right-to-repair-act-and-wildfire-reconstruction','','','2018-09-19 09:52:38','2018-09-19 15:52:38','',0,'http://development.local/shop/uncategorized/the-right-to-repair-act-and-wildfire-reconstruction/',0,'product','',0),(5914,70,'2018-10-01 21:39:32','2018-10-02 03:39:32','Hon. Arthur A. WickHon. Anthony Wheeldin\r\n\r\n&nbsp;\r\n\r\nCourse date - 2/16/18\r\n\r\n52 Pages','Restraining Orders','Hon. Arthur A. Wick<br>Hon. Anthony Wheeldin','publish','closed','closed','','restraining-orders-2','','','2018-10-01 21:39:32','2018-10-02 03:39:32','',0,'http://development.local/shop/uncategorized/restraining-orders-2/',0,'product','',0),(5917,70,'2018-10-02 11:15:04','2018-10-02 17:15:04','','How to not \"Kill\" your Appeal','W. Barton Weitzenberg - Joseph Baxter','publish','closed','closed','','how-to-not-kill-your-appeal','','','2018-10-02 11:15:04','2018-10-02 17:15:04','',0,'http://development.local/shop/uncategorized/how-to-not-kill-your-appeal/',0,'product','',0),(5940,70,'2018-10-03 10:04:44','2018-10-03 16:04:44','','The Best use of a Forensic CPA in a Divorce','','publish','closed','closed','